export default {
  phone(input) {
    if (!input) {
      return {
        status: false,
        msg: '手机号码不能未空'
      }
    }
    if (!/^1[345789][0-9]{9}$/.test(input)) {
      return {
        status: false,
        msg: '手机号码格式不正确'
      }
    }
    return {
      status: true
    }
  },
  website(input) {
    if (!input) {
      return {
        status: false,
        msg: '网址不能为空'
      }
    }
    return {
      status: true
    }
  }
}
